import './Auction.css';
import Product from './Product';
import { useState, useEffect } from "react";


function Auction() {
    const [products, setProducts] = useState([]);
    const [bids, setBids] = useState([]);
    useEffect(() => {
        fetch('http://localhost:5001/api/v1/showBids/9a4449ec-b15a-4ca8-806a-f4d1bbb6375f', {
            method: 'GET',
            headers: {
                Origin: 'http://localhost:3000/'
            }
        }).then((response) => response.json())
            .then((data) => {
                setProducts(data.product);
                setBids(data.bids);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);

    return (
        <div>
            <Product
                productName={products.productName}
                shortDescription={products.shortDescription}
                startPrice={products.startPrice}></Product>
                    <div className="App">
                        <tbody>
                            <tr>
                                <th>Bid Amount</th>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Phone</th>
                            </tr>
                            {bids.map((bid) => {
                                return (
                                    <tr>
                                        <td>${bid.amount}</td>
                                        <td>{bid.firstName}</td>
                                        <td>{bid.email}</td>
                                        <td>{bid.phone}</td>
                                    </tr>
                                );
                            })}
                        </tbody>
                    </div>
        </div>
    );
}

export default Auction;
